  font-size: 11px;
  fill: #777777;
}
.tick line {
  stroke: #e9e9e9;
}
.scrollbar-track {
  position: absolute;
  background: #ccc;
  cursor: default;
  display: none;
}
.scrollbar-handle {
  position: absolute;
  top: 0;
  left: 0;
  height: 100%;
  background: #666;
  border: 0;
  outline: 0;
  box-sizing: border-box;
  padding: 0;
}
.scrollbar-handle:hover {
  background: #333;
}
.scrollbar-handle:active {
  background: #000;
}
.selection-rect {
  opacity: 0;
  border: solid #000 1px;
  position: absolute;
  width: 0;
  height: 0;
  box-sizing: border-box;
  background: #555;
  z-index: 100;
}
.selection-rect.selection-rect-active {
  opacity: 0.5;
}
.legend {
  z-index: 1000;
}
